import React from 'react';
import CartIcon from './CartIcon';
import '../App.js';
import '../style.css';


const NavBar = (props) => {
    return (
        <header>
            <nav className="containerItemList"> 
<li>Home</li>
<li>Products</li>
<li>About Us</li>
<div className="containerCart">
            <CartIcon height={40} width={40} fill={props.fill} />
        </div>
            </nav>

        </header>
    )
}

export default NavBar
